import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <div class="">
          <img src="/images/avatar/large/patrick.png"/>
        </div>
        <div>
            Coppy Right 2019+
        </div>
      </div>
    );
  }
}

export default Footer;
